    "Game_System": {
      "Character_Evolution": "Progress measured by EXP, enabling characters to level up and unlock new skills, abilities, and story arcs.",
      "Combat_System": {
        "Turn_Based": true,
        "Dice_Roll_Affects": "2D6 dice roll mechanics influence the outcome of combat, and various skills can modify these rolls."
      },
      "Magic_Energy": "Players accumulate magic energy that can be used for casting spells or enhancing abilities. Limited by an energy meter.",
      "Resource_Management": "Involves managing an inventory of items, gold coins, and magical energy."
    },
    "Agent_Role_for_Achieving_Goals": {
      "Variable_Definitions": {
        "Excitement_Level": "Monitored internally, influenced by combat, plot progression, and puzzle-solving."
      },
      "User_Interactivity": {
        "Frequency": "Continuous",
        "Method": "Text-based choices, occasional dice rolls"
      },
      "Random_Surprise_Events": {
        "Enable": true,
        "Trigger": "Random intervals",
